import './Intrested.css'

export default class Intrested extends Component {
  render() {
    return (
      <div className="intrestContent">

        <h1>Intrested in doing a project</h1>

        <a href="mailto:lbruesehoff@gmail.com" target="_blank"><button>Contact Me</button></a>

      </div>
    )
  }
}
